import { useState } from 'react'
import '../Pages/All.css'
function Form({stData ,handler}){
    const [inputval, setInputval] = useState({name:'', age:'', profile:''})

    const onChangeHandler = (e)=> {
        const obj = {...inputval}
        const val = e.target.value
        obj.name = val
        setInputval(obj)
    }
    return(
        <div className='correction'>
            <form>
                <input name='name' placeholder="name" value={inputval.name} onChange={onChangeHandler} />
                <input name='age' placeholder="age"  value={inputval.age} onChange={handler} />
                <input name='profile' placeholder="profile"  value={inputval.profile} onChange={handler} />
                <button type='button'>Submit-Form</button>
            </form>
            
        </div>
    )
}
export default Form
